import React, { Component } from 'react'
import style from './Topicrelease.module.css'

export default class Topicrelease extends Component {
  render() {
    return (
      <div>
        <div>
            <div className = {style.releaseiframe}>
                <div className = {style.releaseclose}><button onClick = {this.props.setPage}>关闭</button></div>
                <div className ={style.releaseline}>课题名：<input/></div>
                <div className ={style.releaseline}>开始时间：<input/></div>
                <div className ={style.releaseline}>结束时间：<input/></div>
                <div className ={style.releaseline}>简介：<input/></div>
                <div className ={style.releaseline}>要求：<input/></div>
            </div>
        </div>
      </div>
    )
  }
}
